        <section id="gfanFirstBloc">
            <div class="gfanContainer gfanFlex">
                <h2>
                    Unir les voix de la société civile et des
                    communautés africaines sur le plaidoyer en
                    faveur du Fonds mondial et l'augmentation
                    des ressources nationales pour la santé.
                </h2>
                <p>
                    Le Réseau des défenseurs du Fonds mondial(GFAN)
                    a été créé en 2011 pour unir les voix et les
                    efforts du monde entier en faveur d'un Fonds
                    mondial de lutte contre le sida, la tuberculose
                    et le paludisme entièrement financé. Hébergé par
                    WACI Health à Nairobi, au Kenya, le GFAN Afrique
                    a construit un mouvement social à l'échelle du
                    continent qui exige la santé pour tous en
                    recrutant, en connectant et en mobilisant des
                    défenseurs pour communiquer le besoin urgent de
                    reconstituer avec succès les ressources du Fonds
                    mondial.
                </p>
                <p>
                    S'appuyant sur les dossiers d'investissement du
                    Fonds mondial, les membres de GFAN Afrique
                    s'adressent aux pays chargés de la mise en œuvre,
                    aux donateurs, au secteur privé et aux fondations
                    pour qu'ils contribuent au Fonds mondial afin que
                    les ressources collectées soient utilisées pour
                    renforcer les systèmes de santé, prévenir les
                    nouvelles infections par le VIH, la tuberculose
                    et le paludisme, et sauver des vies.
                </p>
            </div>
