                <div id="gfanObjectifsInner" class="gfanFlex">
                    <div class="gfanObjectifsItem gfanFlex gfanFlexColumn">
                        <h3>01.</h3>
                        <h3>Soutenir le plaidoyer et la mobilisation
                            des ressources.
                        </h3>
                        <p>
                            Renforcer et soutenir les membres de GFAN
                            Afrique dans le développement et la mise
                            en œuvre de stratégies de plaidoyer
                            (y compris le travail avec les médias)
                            sur la santé mondiale et la mobilisation
                            des ressources pour le Fonds mondial.
                        </p>
                    </div>
                    <div class="gfanObjectifsItem gfanFlex gfanFlexColumn">
                        <h3>02.</h3>
                        <h3>
                            Action de soutien.                            
                        </h3>
                        <p>
                            Initier et soutenir des actions puissantes
                            des membres de GFAN Afrique au niveau
                            régional et national.
                        </p>
                    </div>
                    <div class="gfanObjectifsItem gfanFlex gfanFlexColumn">
                        <h3>03.</h3>
                        <h3>
                            Construire le mouvement.
                        </h3>
                        <p>
                            Faciliter et étendre le réseau de membres
                            en soutien au Fonds mondial, avec une
                            participation accrue des défenseurs et
                            des communautés affectées dans les pays
                            de mise en œuvre, les pays donateurs
                            actuels et les nouveaux pays donateurs
                            potentiels.
                        </p>
                    </div>
                </div>
            </div>
        </section><!--End gfanObjectifs-->

