        <section id="gfanMeetTheTarget">
            <div class="gfanContainer gfanFlex gfanFlexColumn">
                <div class="gfanHeadings">
                    <h2>
                        Rejoignez la campagne #MeetTheTarget
                    </h2>
                </div>
                <p>
                    <span class="gfanOrangeTxt">"Meet The Target"</span> est une campagne mondiale
                    de plaidoyer de GFAN Afrique qui se déroule
                    jusqu'en 2026. Sa première phase a consisté
                    à inciter les dirigeants mondiaux à atteindre
                    l'objectif d'au moins 18 milliards de dollars
                    lors de la 7e reconstitution des ressources
                    du Fonds mondial afin de sauver 20 millions
                    de vies au cours des trois prochaines années.
                    Elle vise également à inciter les dirigeants
                    nationaux à mobiliser davantage de ressources
                    nationales pour la santé en Afrique et à
                    augmenter progressivement le budget national
                    alloué à la santé en Afrique. Cette campagne
                    met particulièrement l'accent sur le
                    renforcement des communautés afin que la lutte
                    contre le VIH, la tuberculose et le paludisme
                    reste en tête de l'agenda des dirigeants
                    mondiaux.
                </p>
